import React from 'react';

function CommentsList({ comments }) {
  return (
    <div className="card p-3">
      {comments.map((x) => {
        return (
          <h2>
            {x.name}: {x.email}
          </h2>
        );
      })}
    </div>
  );
}

export default CommentsList;
